import bz2
import json

# load base item: bz2.decompress -> optional(.encode('utf8')) -> json.loads
zip_base = {
  "Atlantis" : {
      "BHCAN": b'',
      "C1CAN": b''
    },
  "CUSW" : {
      "BHCAN": b'',
      "CCAN": b''
    },
  "PNET" : {
      "BHCAN": b'',
      "CCAN": b''
    }
  }

class CANDB(object):
	""" database for single architect """
	def __init__(self, arch, can):
		super().__init__()
		self.dict = zip_base[arch][can]
		self.dict = json.loads(bz2.decompress(self.dict))

